import React from 'react'

const ExerciseList = ({ exercises }) => {
    return (
        <div className="well">
            {exercises.map(exercise => (
                <div className="row ex-one">
                    <div className="col-md-4 wo-ex-name">
                        <h3><a href={exercise._id._id} className="left-nav-link">{exercise._id.name}</a></h3>
                    </div>
                    <div className="col-md-3 img-div">
                        <img src={exercise._id.picture.url} alt={exercise.name} className="card-img"/>
                    </div>
                    <div className="col-md-2 wo-reps-sets">
                        <p className="sets">{exercise.sets} sets</p>
                        <p>{exercise.reps} reps</p>
                    </div>
                    <div className="col-md-2">
                        <p>Exercise type: {exercise._id.exerciseType}</p>
                        <p>Muscles worked: {exercise._id.muscleGroup}</p>
                        <p>Equipment used: {exercise._id.equipment}</p>

                    </div>
                </div>
            )) }
        </div>
    )
}

export default ExerciseList


